import '../index.css'

const List = ({ item, handleDelete ,index}) => {
  return (
    <>
      <>
        <li className="d-flex text-center" style={{padding:"5px" , alignItems: "baseline"}}>
        <i className="icon fa fa-times" area-hidden="true"
             onClick={()=> handleDelete(index)}  ></i>
          <h3 style={{marginLeft:"7px", marginBottom:"none"}}>{item}</h3>

        </li>
      </>
    </>
  );
};

export default List;
